import logo from './logo.svg';
import './App.css';
import Signup from './components/signup';
import { Route, Routes } from 'react-router-dom';
import Login from './components/login';

function App() {
  return (
    <div className="App">
<Routes>
  <Route path="/" element={<Signup/>}/>
  <Route path="/login" element={<Login/>}/>

</Routes>
    </div>
  );
}

export default App;
